function resetUl(){$("ul").empty().wrapInner("<li></li><li></li><li></li><li></li>")}$(window).load(function(){if(localStorage.length!==0){for(a=1;a<=localStorage.length;a++){$($("li")[a-1]).append(localStorage.getItem("item"+a))}}});$(document).ready(function(){$(".carousel").carousel({interval:3800});$($("button")[1]).click(function(){localStorage.clear();resetUl()});$($("button")[0]).click(function(){var e=0;for(i=0;i<$("li").length;i++){e++;if($("li")[i].innerHTML!=""){localStorage.setItem("item"+e,$("li")[i].innerHTML)}else{e--}}});$(function(){$('[data-toggle="tooltip"]').tooltip()})})